            </div>

          })
        }
      </div>
      <p class="text-right"><a href="/template/free/all-purchase-news" class="ml-1 mt-1 text-sm leading-tight font-medium text-black hover:underline">ข่าวจัดซื้อจัดจ้างทั้งหมด</a></p>

    </div>
  )
}
